https://www.gouvernement.fr/communique/comite-de-lintelligence-artificielle

Le gouvernement vient de créer un comité pour l'IA avec 3 objectifs : 

-Renforcer les formations pour développer davantage de talents en France ;
-Investir pour favoriser l’innovation française sur la scène internationale ;
-Définir une régulation adaptée des différents secteurs pour protéger des dérives ;
